import LandingSection from"./LandingSection/LandingSection"
import AboutSection from "./AboutSection/AboutSection"
import styled from "styled-components"
import BlankPhone from "../../frontend/src/images/blank-phone-vertical.svg"
import FingerprintSrc from"../../frontend/src/images/fingerprint.svg"
import { useSpring, animated, config } from "react-spring"

const PhoneContainer = styled.div`
    width: 50%;
    margin-top: -30px;
    margin-left: -30px;
    // background-color: #0f0;
    position: absolute;
`

const PhoneImg= styled.img`
    margin-left: 50px;

`

function Fingerprint() {
  const props = useSpring ({
      to: { opacity: 1 },
      from: { opacity: 0 },
      reset: false,
      delay: 2600,
      config: config.molasses
  })
  return <FingerprintImg src={FingerprintSrc} />
}

function App() {
  return (
    <div className="App">
      <PhoneContainer>
                    <PhoneImg src={BlankPhone}/>
                    {Fingerprint()}
                    {/* <ProgressCircleHolder>
                        pain
                    </ProgressCircleHolder> */}
                    {/* <FingerprintImg src={FingerprintSrc}></FingerprintImg> */}
      </PhoneContainer>
      <LandingSection />
      <AboutSection />
    </div>
  );
}

export default App;
